import React, {useState} from 'react'
import Axios from 'axios'

function Test() {

  const [data,setData] = useState([]);
  const [dName,setDName] = useState("");

  const getTest = () => {
    Axios.get("http://45.77.232.166:8080/get-pcos").then((response)=> {
      console.log(response);
      setData(response.data);
      data.forEach();
      setDName(data[0].name);

    })
  }

  return(
    <div>
      <button onClick={getTest}>Get Info</button>
      <text>Name : {dName}</text>
    </div>
    
  );
}

export default Test;
